const Card = (props) => {
  return (
    <div className='bg-light-green dib br3 pa3 ma2 grow'>
      <img alt="robots" src='https://robohash.org/test?200x200' />
      <div>
        <h2>{props.name}</h2>
        <p>{props.age}</p>
      </div>
    </div>
  );
}

export default Card;
